import React, { useState, useEffect } from "react"
import { useDispatch } from "react-redux";
import {fetchUserData} from '../../services/authService'
import { useNavigate } from "react-router-dom";
// import {Menu, Button} from 'antd'
import { Button, Menu } from 'antd';
// import { getCurrentUser } from "../../redux/authActions";

export const Dashboard = (props) => {
    const [loading, setLoading] = useState(false);
    const [data, setData] = useState({});
    const dispatch = useDispatch();
    const navigate = useNavigate()


    useEffect(() => {
        fetchUserData().then((response) => {
            setData(response.data)
        }).catch((e) => {
            localStorage.clear();
            navigate("/login");
        })
    }, [])

    console.log("response.data->", );

    const logout = () => {
        localStorage.clear();
        navigate("/");
    }

    return(
        <div>
            <Menu theme="dark" mode="inline" >
            <Menu.Item key="dashboard">Dashboard</Menu.Item>
            {/* <Menu.Item key="user">{data && `${data.firstName} ${data.lastName}`}</Menu.Item > */}
            <Menu.Item key={data}>{data && `${data.firstName} ${data.lastName}`}</Menu.Item>
            <Menu.Item key="logout"><Button onClick = {logout}>Logout</Button></Menu.Item>
            </Menu>
        </div>
        // <Menu>
        //         <h4>Hello {data && `${data.firstName} ${data.lastName}`}</h4>
        //         <br></br>
        //         {/* <h4>Hello {currentUser && `${currentUser.firstName} ${currentUser.lastName}`}</h4> */}
        //         <Button style={{marginTop:'5px'}} onClick={() =>logout()}>Logout</Button>
        // </Menu>
    )
    
}
